    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-09-26T22:59:22.300575",nt"name":
    "noaa-orthorectified-digital-elevation-model-dem-image-tiles-bombay-hook-delaware-2011-nodc-acce",nt"isopen":
    false,nt"url": null,nt"notes": "The NOAA Bombay Hook Project covers 177
    square kilometers of the Bombay Hook National Wildlife Refuge and surrounding areas
    in Kent County, Delaware. The Dewberry company produced ortho mosaics for 101 tiles
    (1700 m x 1700 m) covering this area. The images were created with a 25cm cell size.
    These images provide a snapshot in time that depicts the ground surface and water
    features for use in coastal management. These Digital Elevation Models (DEMs) are
    created to the specifications outlined by NOAA CSC in partnership with the Delaware
    Department of Natural Resources and Environmental Control (DNREC).nnThese images
    are in ERDAS commercial software .img format which may be read by GIS software and
    various computer languages. Associated Reduced Resolution Dataset (.rrd) files,
    HIStory (.his) files, browse image (.jpg) files, and individual (.xml) and collection
    level metadata in Federal Geographic Data Committee (FGDC) format are included in
    the dataset.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
